import React from 'react';
import {
	BrowserRouter as Router,
	Route,
	Switch
} from 'react-router-dom';
import SignIn from './SignIn'
import Recommendations from './Recommendations';
//import Recommendations from './Recommendations';
import BestGenres from './BestGenres';
import Login from './Login'

export default class App extends React.Component {

	render() {
		return (
			<div className="App">
				<Router>
					<Switch>
						<Route
							exact
							path="/"
							render={() => (
								<Recommendations />
							)}
						/>
						<Route
							exact
							path="/recommendations"
							render={() => (
								<Recommendations />
							)}
						/>
						<Route
							exact
							path="/login"
							render={() => (
								<Login />
							)}
						/>
						<Route
							exact
							path="/signup"
							render={() => (
								<Login />
							)}
						/>
						<Route
							exact
							path="/addAccount"
							render={() => (
								<Login />
							)}
						/>
						<Route
							path="/bestgenres"
							render={() => (
								<BestGenres />
							)}
						/>
					</Switch>
				</Router>
			</div>
		);
	}
}
